import React from 'react';
import "./VideoCard.scss";

export default function VideoCard(props) {
    return (
        <article className="video-card">

            <div >
                <img className="video-card__thumbnail" src={props.thumbnail} alt=""/>
            </div>
            <div>
                <p>{props.title}</p>
                <p>{props.channel}</p>
            </div>
        </article>
    )
}
